openapi: 3.0.1
info:
  title: MultiMarkets-BusinessAPI-EN
  description: >-
    Providing API to TOB business side, which can provide various types of
    support such as customer information, fund management, activity push, etc.
  version: 1.0.0
tags:
  - name: Auth
  - name: Basic
  - name: Product
  - name: Fund
  - name: Customer
  - name: Message
  - name: Trade
  - name: Trade/Spot
  - name: Activities
  - name: Markets/HTTP
paths:
  /tradeapi.admin.OrderAdminApiService.queryCapitalFlowList:
    post:
      summary: Funds detail query
      deprecated: false
      description: |-
        group=tradeApi
        version=0.0.1
        bizType=tradeapi.admin.OrderAdminApiService.queryCapitalFlowList
      tags:
        - Trade
      parameters:
        - name: trace
          in: header
          description: Global link unique identifier
          required: true
          example: '{{mock_trace}}'
          schema:
            type: string
        - name: companyId
          in: header
          description: Company ID
          required: true
          example: '{{company}}'
          schema:
            type: string
        - name: token
          in: header
          description: Token after B-end authentication
          required: true
          example: '{{auto_token}}'
          schema:
            type: string
        - name: version
          in: header
          description: Interface version number
          required: true
          example: 0.0.1
          schema:
            type: string
        - name: group
          in: header
          description: Interface grouping
          required: true
          example: tradeApi
          schema:
            type: string
      requestBody:
        content:
          application/json:
            schema:
              type: object
              properties:
                customerId:
                  type: string
                customerGroupId:
                  type: string
                customerNo:
                  type: string
                tradeType:
                  type: integer
                  description: Game ID
                accountId:
                  type: number
                  description: Account ID
                accountCurrency:
                  type: string
                  description: Account currency
                size:
                  type: integer
                  description: Number of items per page
                current:
                  type: integer
                  description: Current page
                businessType:
                  type: number
                  description: >-
                    Business type. 0-unrestricted; CFD-full position: 1-deposit;
                    2-withdrawal; 3-system reset; 4-limit adjustment; 5-freeze;
                    6-trade; 36-transfer; 42-reward; CFD-margin: 7-deposit;
                    8-withdrawal; 9-system reset; 10-limit adjustment;
                    11-freeze; 12-trade; 13-margin adjustment; 37-transfer;
                    43-reward; Leverage: 14-deposit; 15-withdrawal; 16-limit
                    adjustment; 17-freeze; 18-trade; 19-auto loan; 20-manual
                    loan; 21-auto repayment; 22-manual repayment; 23-loan
                    interest; 35-back-end repayment; 38-transfer; 40-force
                    liquidation repayment; 44-reward; ABCC: 24-deposit;
                    25-withdrawal; 26-limit adjustment; 27-freeze; 28-trade;
                    29-auto loan; 30-manual loan; 31-auto repayment; 32-manual
                    repayment; 33-loan interest; 34-back-end repayment;
                    39-transfer; 41-force liquidation repayment; 45-reward; Spot
                    leverage matching: 50-deposit; 51-withdrawal; 52-limit
                    adjustment; 53-freeze; 54-trade; 55-transfer; 59-reward;
                    Stocks: 601-deposit; 602-withdrawal; 603-limit adjustment;
                    604-freeze; 605-collateral; 606-trade; 607-loan;
                    608-repayment; 609-transfer; 610-interest calculation;
                    611-interest settlement; 612-reward; 613-system reset;
                    614-company action
                status:
                  type: integer
                  description: >-
                    Status. 0-Unrestricted; 1-Initialized; 2-Processed
                    successfully; 3-Processing failed;
                startTime:
                  type: number
                  description: Start time. 13-digit timestamp; 7 days before today
                endTime:
                  type: number
                  description: End time. 13-digit timestamp; usually today
                operate:
                  type: integer
                  description: Flow direction. 0-Unrestricted; 1. Increase, 2. Decrease;
                assetsId:
                  type: number
                  description: Asset Id;
                lang:
                  type: string
                  description: >-
                    Language (zh_CN-Chinese; en_US-English. Default to Chinese
                    if not filled or filled incorrectly);
              required:
                - tradeType
                - customerNo
                - customerGroupId
                - customerId
            example:
              tradeType: 5
              customerNo: '86000020'
              customerGroupId: '1'
              customerId: '21'
              current: 1
              size: 20
              startTime: 1668528000000
              endTime: 1669219199999
      responses:
        '200':
          description: Success
          content:
            application/json:
              schema:
                type: object
                properties: {}
      security: []
