  /quote-b-api/depth-tick:
    get:
      summary: Latest market quote query [digital currency, forex]
      deprecated: false
      description: ''
      tags:
        - Markets/HTTP
      parameters:
        - name: token
          in: query
          description: >-
            If you do not know your token, please contact relevant personnel to
            request it
          required: true
          example: 65b31e26-312c-4e71-89ae-f5e33073d1c8-1676446387481
          schema:
            type: string
        - name: query
          in: query
          description: >-
            Please encode the following fields, the backend service will decode
            them upon receiving

            {
                "trace": "enim occaecat dolore esse voluptate",
                "data": {
                    "symbol_list": [
                        {
                            "code": "GBPJPY"
                        },
                        {
                            "code": "CADJPY"
                        }
                    ]
                }
            }

            trace: Trace code, used for log query, please ensure it is unique
            for each request

            code: Please refer to the code list and select the code you want to
            query
          required: true
          example: >-
            %7B%20%20%20%20%22trace%22%3A%20%22enim%20occaecat%20dolore%20esse%20voluptate%22%2C%20%20%20%20%22data%22%3A%20%7B%20%20%20%20%20%20%20%20%22symbol_list%22%3A%20%5B%20%20%20%20%20%20%20%20%20%20%20%20%7B%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%22code%22%3A%20%22GBPJPY%22%20%20%20%20%20%20%20%20%20%20%20%20%7D%2C%20%20%20%20%20%20%20%20%20%20%20%20%7B%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%22code%22%3A%20%22CADJPY%22%20%20%20%20%20%20%20%20%20%20%20%20%7D%20%20%20%20%20%20%20%20%5D%20%20%20%20%7D%7D
          schema:
            type: string
      responses:
        '200':
          description: OK
          content:
            application/json:
              schema:
                type: object
                properties:
                  ret:
                    type: integer
                    description: Return code
                  msg:
                    type: string
                    description: Message corresponding to the return code
                  trace:
                    type: string
                    description: Requested trace
                  data:
                    type: object
                    properties:
                      tick_list:
                        type: array
                        items:
                          type: object
                          properties:
                            code:
                              type: string
                              description: Code
                            seq:
                              type: string
                              description: Quote number
                            tick_time:
                              type: string
                              description: Quote timestamp
                            bids:
                              type: array
                              items:
                                type: object
                                properties:
                                  price:
                                    type: string
                                    description: Price
                                  volume:
                                    type: string
                                    description: Volume
                              description: Bid List
                            asks:
                              type: array
                              items:
                                type: object
                                properties:
                                  price:
                                    type: string
                                    description: Price
                                  volume:
                                    type: string
                                    description: Volume
                              description: Ask List
                    required:
                      - tick_list
                required:
                  - ret
                  - msg
                  - trace
                  - data
              examples:
                '1':
                  summary: Success
                  value:
                    ret: 200
                    msg: ok
                    trace: asdfsdfa
                    data:
                      tick_list:
                        - code: 857.HK
                          seq: '30686349'
                          tick_time: '1677830357227'
                          bids:
                            - price: '136.424'
                              volume: '100000.00'
                          asks:
                            - price: '136.427'
                              volume: '400000.00'
      security: []
  /customer.app.CustomerWebApiService.checkCustomerExist:
    post:
      summary: Check if customer information exists
      deprecated: false
      description: |-
        version=0.0.1
        bizType=customer.app.CustomerWebApiService.checkCustomerExist
      tags:
        - Customer
      parameters:
        - name: trace
          in: header
          description: Global link unique identifier
          required: true
          example: '{{mock_trace}}'
          schema:
            type: string
        - name: companyId
          in: header
          description: Company ID
          required: true
          example: '{{company}}'
          schema:
            type: string
        - name: version
          in: header
          description: Interface version number
          required: true
          example: 0.0.1
          schema:
            type: string
      requestBody:
        content:
          application/json:
            schema:
              type: object
              properties:
                type:
                  type: integer
                  description: >-
                    Registration login method: 1 email, 2 phone number, 3
                    customer account
                loginName:
                  type: string
                  description: 'Account: email/phone number'
                phoneArea:
                  type: string
                  description: Mobile area code, default area code is +86
                emailArea:
                  type: string
                  description: Email area code, default area code is +86
              required:
                - type
                - loginName
            example:
              type: 2
              loginName: '{{mock_phone}}'
              protocol: 'true'
              emailArea: '+86'
              phoneArea: '+86'
      responses:
        '200':
          description: Success
          content:
            application/json:
              schema:
                type: object
                properties: {}
      security: []
  /message.admin.VerificationAdminService.queryCodeSendStatus:
    post:
      summary: Check verification code status
      deprecated: false
      description: ''
      tags:
        - Message
      parameters:
        - name: trace
          in: header
          description: ''
          required: true
          example: '{{mock_trace}}'
          schema:
            type: string
        - name: version
          in: header
          description: ''
          required: true
          example: 0.0.1
          schema:
            type: string
        - name: companyId
          in: header
          description: ''
          required: true
          example: '{{company}}'
          schema:
            type: string
      requestBody:
        content:
          application/json:
            schema:
              type: object
              properties:
                bizType:
                  type: string
                  title: Business type
                  description: >-
                    EMAIL_COMMON_VERIFICATION_CODE - Email common verification
                    code; EMAIL_LOGIN_VERIFICATION_CODE - Email login
                    verification code; EMAIL_REGISTER_VERIFICATION_CODE - Email
                    registration verification code;
                    EMAIL_PASSWORD_VERIFICATION_CODE - Email forgot password
                    verification code; SMS_COMMON_VERIFICATION_CODE - SMS common
                    verification code; SMS_LOGIN_VERIFICATION_CODE - SMS login
                    verification code; SMS_REGISTER_VERIFICATION_CODE - SMS
                    registration verification code;
                    SMS_PASSWORD_VERIFICATION_CODE - SMS forgot password
                    verification code
                toUser:
                  type: string
                  title: Recipient
                code:
                  type: string
                  title: Verification code
                sendToken:
                  type: string
                  title: Send receipt
                  description: Token returned by C-end verification code sending interface
              required:
                - bizType
                - toUser
                - code
                - sendToken
            example: ''
      responses:
        '200':
          description: Success
          content:
            application/json:
              schema:
                type: object
                properties:
                  code:
                    type: string
                    title: System common return code
                    description: 0 - Success, other exceptions
                  msg:
                    type: string
                    title: Return information
                  bizCode:
                    type: string
                    title: Module identifier code
                  tm:
                    type: integer
                    title: Processing time (milliseconds)
                  trace:
                    type: string
                    title: Global link flag information
                  msgParams:
                    type: string
                    title: >-
                      Placeholder parameter string in return description,
                      multiple parameters separated by commas
                  data:
                    type: object
                    properties:
                      bizType:
                        type: string
                        title: Business type
                      toUser:
                        type: string
                        title: Recipient
                      sendToken:
                        type: string
                        title: Send receipt
                      code:
                        type: string
                        title: Verification code
                      status:
                        type: string
                        title: Verification code status code
                        description: 0-Initialization; 1-Pending use; 2-Used; 3-Expired
                      name:
                        type: string
                        title: Verification code status name
                      desc:
                        type: string
                        title: Verification code status description
                    required:
                      - bizType
                      - toUser
                      - sendToken
                      - code
                      - status
                      - name
                      - desc
                    title: Response body
                required:
                  - code
                  - msg
                  - bizCode
                  - tm
                  - trace
                  - msgParams
                  - data
      security: []
