  /quote-b-api/trade-tick:
    get:
      summary: Latest transaction price query [digital currency, foreign exchange]
      deprecated: false
      description: ''
      tags:
        - Markets/HTTP
      parameters:
        - name: token
          in: query
          description: >-
            If you do not know your token, please contact relevant personnel to
            request it
          required: true
          example: 65b31e26-312c-4e71-89ae-f5e33073d1c8-1676446387481
          schema:
            type: string
        - name: query
          in: query
          description: >-
            Please encode the following fields, the backend service will decode
            them upon receiving

            {
                "trace": "enim occaecat dolore esse voluptate",
                "data": {
                    "symbol_list": [
                        {
                            "code": "GBPJPY"
                        },
                        {
                            "code": "CADJPY"
                        }
                    ]
                }
            }

            trace: Trace code, used for log query, please ensure it is unique
            for each request

            code: Please refer to the code list and select the code you want to
            query
          required: true
          example: >-
            %7B%20%20%20%20%22trace%22%3A%20%22enim%20occaecat%20dolore%20esse%20voluptate%22%2C%20%20%20%20%22data%22%3A%20%7B%20%20%20%20%20%20%20%20%22symbol_list%22%3A%20%5B%20%20%20%20%20%20%20%20%20%20%20%20%7B%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%22code%22%3A%20%22GBPJPY%22%20%20%20%20%20%20%20%20%20%20%20%20%7D%2C%20%20%20%20%20%20%20%20%20%20%20%20%7B%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%22code%22%3A%20%22CADJPY%22%20%20%20%20%20%20%20%20%20%20%20%20%7D%20%20%20%20%20%20%20%20%5D%20%20%20%20%7D%7D
          schema:
            type: string
      responses:
        '200':
          description: OK
          content:
            application/json:
              schema:
                type: object
                properties:
                  ret:
                    type: integer
                    description: Return code
                  msg:
                    type: string
                    description: Message corresponding to the return code
                  trace:
                    type: string
                    description: Requested trace
                  data:
                    type: object
                    properties:
                      tick_list:
                        type: array
                        items:
                          type: object
                          properties:
                            code:
                              type: string
                              description: Code
                            seq:
                              type: string
                              description: Serial number
                            tick_time:
                              type: string
                              description: Timestamp
                            price:
                              type: string
                              description: Transaction price
                            volume:
                              type: string
                              description: Transaction volume
                            turnover:
                              type: string
                              description: Transaction amount
                            trade_direction:
                              type: integer
                              description: >-
                                Trading direction, 0 for default, 1 for BUY, 2
                                for SELL
                    required:
                      - tick_list
                required:
                  - ret
                  - msg
                  - trace
                  - data
              examples:
                '1':
                  summary: Success
                  value:
                    ret: 200
                    msg: ok
                    trace: asdfsdfa
                    data:
                      tick_list:
                        - code: 857.HK
                          seq: '30841439'
                          tick_time: '1677831545217'
                          price: '136.302'
                          volume: '0'
                          turnover: '0'
                          trade_direction: 0
      security: []
