    post:
      summary: Get product basic information list
      deprecated: false
      description: |-
        version=0.0.1
        bizType=config.admin.AdminSymbolDubboService.getSymbolByCompanyId
      tags:
        - Product
      parameters:
        - name: trace
          in: header
          description: Global link unique identifier
          required: true
          example: '{{mock_trace}}'
          schema:
            type: string
        - name: companyId
          in: header
          description: Company ID
          required: true
          example: '{{company}}'
          schema:
            type: string
        - name: token
          in: header
          description: Token after B-end authentication
          required: true
          example: '{{auto_token}}'
          schema:
            type: string
      requestBody:
        content:
          application/json:
            schema:
              type: object
              properties:
                companyId:
                  type: string
                  description: Company ID
                tradeType:
                  type: integer
                  description: Game type
                trace:
                  type: string
                  description: Tracking code. Preferably included for easy issue tracking
              required:
                - companyId
            example:
              companyId: '{{company}}'
      responses:
        '200':
          description: Success
          content:
            application/json:
              schema:
