          example: 65b31e26-312c-4e71-89ae-f5e33073d1c8-1676446387481
          schema:
            type: string
        - name: query
          in: query
          description: "Please encode the following fields, the backend service will decode after receiving\n{\n    \"trace\": \"culpa cillum ea reprehenderit occaecat\",\n    \"data\": {\n        \"code\": \"GBPJPY\",\n        \"kline_type\": 1,\n        \"kline_timestamp_end\": 0,\n        \"query_kline_num\": 2, \t\"adjust_type\": 0     } } trace: tracking code, used for log query, please ensure it is unique for each request code: please refer to the code list, select the code you want to query kline_type: k-line type, 1 for 1-minute K, 2 for 5-minute K, 3 for 15-minute K, 4 for 30-minute K, 5 for hourly K, 6 for 2-hour K, 7 for 4-hour K, 8 for daily K, 9 for weekly K, 10 for monthly K kline_timestamp_end: the time point to query from, 0 means from current time, only valid for non-stock codes query_kline_num: how many K-lines to query, maximum of 1000 adjust_type: adjustment type, only valid for stock codes, e.g. 0: ex-rights, 1: pre-adjustment"
          required: true
          example: "{% '{\"trace\": \"culpa cillum ea reprehenderit occaecat\",\"data\": {\"code\": \"GBPJPY\",\r\n\"kline_type\": 1,\"kline_timestamp_end\": 0,\"query_kline_num\": 2,\"adjust_type\": 0}}'|encodeURIComponent %}"
          schema:
            type: string
      responses:
        '200':
          description: OK
          content:
            application/json:
              schema:
                type: object
                properties:
                  ret:
                    type: integer
                  msg:
                    type: string
                  trace:
                    type: string
                  data:
                    type: object
                    properties:
                      code:
                        type: string
                        description: Code
                      kline_type:
                        type: integer
                        description: >-
                          K line types, 1 for 1-minute K, 2 for 5-minute K, 3
                          for 15-minute K, 4 for 30-minute K, 5 for hourly K, 6
                          for 2-hour K, 7 for 4-hour K, 8 for daily K, 9 for
                          weekly K, 10 for monthly K
                      kline_list:
                        type: array
                        items:
                          type: object
                          properties:
                            timestamp:
                              type: string
                              description: Timestamp of the K line
                            open_price:
                              type: string
                              description: Opening price of the K line
                            close_price:
                              type: string
                              description: Closing price of the K line
                            high_price:
                              type: string
                              description: Highest price of the K line
                            low_price:
                              type: string
                              description: Lowest price of the K line
                            volume:
                              type: string
                              description: Volume of the K line
                            turnover:
                              type: string
                              description: Amount of transactions of the K line
                          required:
                            - timestamp
                            - open_price
                            - close_price
                            - high_price
                            - low_price
                            - volume
                            - turnover
                    required:
                      - code
                      - kline_type
                      - kline_list
                required:
                  - ret
                  - msg
                  - trace
                  - data
              examples:
                '1':
                  summary: Success
                  value:
                    ret: 200
                    msg: ok
                    trace: asdfsdfa
